#!/bin/sh
# Name: KInfo
# Author: Gabo11
# Icon: data:image/png;base64,

eips -c > /dev/null 2>&1 
sleep 2
eips 0 0 "$echo KInfo: Shows Kindle Info (v0.2)" > /dev/null 2>&1
eips 0 1 "$echo Full Firmware Version:" > /dev/null 2>&1
eips 1 2 "$(cat "/etc/prettyversion.txt" 2> /dev/null || echo "Unknown" )" > /dev/null 2>&1
eips 0 3 "$echo Firmware Number:" > /dev/null 2>&1
eips 1 4 "$(cat "/var/local/system/CURRENT_SOFTWARE_VERSION" 2> /dev/null || echo "Unknown" )" > /dev/null 2>&1
eips 0 5 "$echo Hotfix Version:" > /dev/null 2>&1
eips 1 6 "$(cat "/mnt/us/documents/Run Hotfix.run_hotfix" 2> /dev/null || echo "Unknown" )" > /dev/null 2>&1
eips 0 7 "$echo Serial Number:" > /dev/null 2>&1
eips 1 8 "$(cat "/proc/idme/serial" 2> /dev/null || echo "Unknown" )" > /dev/null 2>&1
eips 0 9 "$echo Wifi MAC:" > /dev/null 2>&1
eips 1 10 "$(cat "/proc/idme/mac_addr" 2> /dev/null || echo "Unknown" )" > /dev/null 2>&1
eips 0 11 "$echo Bluetooth MAC:" > /dev/null 2>&1
eips 1 12 "$(cat "/proc/idme/bt_mac_addr" 2> /dev/null || echo "Unknown" )" > /dev/null 2>&1
eips 0 13 "$echo Closing in 10s..." > /dev/null 2>&1
sleep 10
eips -c > /dev/null 2>&1
lipc-set-prop com.lab126.appmgrd start app://com.lab126.booklet.home
